import React from 'react';

function Footer() {
  return (
    <footer className="fixed-bottom row">
      <div className="col col-md-6 d-flex justify-content-center">
        <h3>Coconut Creek</h3>
      </div>
      <div className="col col-md-6 d-flex justify-content-center">
        <h3>West Palm Beach</h3>
      </div>
    </footer>
  );
}

export default Footer;
